import React from 'react';
import cls from './menu.module.scss'
import {
    BankIcon,
    BigUserIcon, LogoutIcon,
    SettingsIcon,
    Users2Icon,
    Wallet1Icon,
    Wallet2Icon,
    WalletPlusIcon
} from "../../assets/icons";
import {Link} from "react-router-dom";

const Menu = () => {

    const navList = [
        {
            title: 'Sozlamalar',
            href: '/sozlamalar',
            icon: <SettingsIcon />
        },
        {
            title: 'Savdo qilish',
            href: '/savdo',
            icon: <BankIcon />
        },
        {
            title: 'Bank kartasi',
            href: '/my-cards',
            icon: <WalletPlusIcon />
        },
        {
            title: 'Mening jamoam',
            href: '/my-team',
            icon: <Users2Icon />
        },
        {
            title: 'Hisobdan chiqish',
            href: '/log-out',
            icon: <LogoutIcon />
        },
    ]

    return (
        <div className={cls.menu}>
            <div className="container" style={{padding: '0'}}>
                <div>
                    <div className={cls.head}>
                        <div className='row align-center'>
                            <BigUserIcon />
                            <div style={{marginLeft: '1rem'}}>
                                <span className={cls.head__txt} style={{marginBottom: '10px'}}>Ism familiya</span>
                                <span className={cls.head__txt}>+998991928124</span>
                            </div>
                        </div>
                        <p className={cls.head__usd}>100 usdt = 1 180 000 so’m</p>
                        <div className='row evenly' style={{marginBottom: '0'}}>
                            <Link className={cls.head__link} to='/hisob'>
                                <Wallet1Icon />
                                <span>Hisobni to’ldirish</span>
                            </Link>
                            <Link className={cls.head__link} style={{marginBottom: '0'}} to=''>
                                <Wallet2Icon />
                                <span>Hisobni chiqarish</span>
                            </Link>
                        </div>
                    </div>
                    <div className={cls.body}>
                        <div className={cls.body__wrapper}>
                            <ul className={cls.body__list}>
                                {
                                    navList.map((item, i) => (
                                        <li key={i}>
                                            <Link className={cls.body__link} to={item.href}>
                                                <div className='row align-center'>
                                                    { item.icon }
                                                    <span>{ item.title }</span>
                                                </div>
                                                <i className="fa-solid fa-chevron-right"/>
                                            </Link>
                                        </li>
                                    ))
                                }
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Menu;
